import React from 'react';
import styled from 'styled-components';

const MainHeader = styled.header`
    background: #fff;
    position: relative;
    width: 100%;
    height: 69px;
    button {
        line-height: 1;
        border: none;
        background: none;
    }
`

class Header extends React.Component {


    render() {
        return (
            <MainHeader>

            </MainHeader>
        );
    }
}

export default Header;
